import React from 'react';
import Col from "react-bootstrap/Col";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";

const PracticeArea = () => {
    return (
        <div>
            <Container>
                <Row>
                    <Col></Col>
                    <Col xs={7}>2 of 3 (wider)</Col>
                    <Col></Col>
                </Row>
            </Container>
        </div>
    )
}

export default PracticeArea
